import React, { useState, useEffect } from 'react';
import ProductList from '../components/ProductList';

const bannerImages = [
  'https://rukminim1.flixcart.com/flap/1688/280/image/633789f7def60050.jpg?q=50',
  'https://rukminim1.flixcart.com/flap/1688/280/image/ab7e2b022a4587dd.jpg?q=50',
  'https://rukminim1.flixcart.com/flap/1688/280/image/22fddf3c7a1f0f6f.jpg?q=50',
];


const dealOfTheDayProducts = [
  { id: 101, name: 'Gaming Console', price: 45000, image: 'https://cdn.pixabay.com/photo/2014/05/02/21/50/game-controller-336645_1280.jpg' },
  { id: 102, name: 'Wireless Mouse', price: 1200, image: 'https://cdn.pixabay.com/photo/2014/04/03/10/32/mouse-310567_1280.png' },
  { id: 103, name: 'Mechanical Keyboard', price: 7000, image: 'https://cdn.pixabay.com/photo/2016/11/29/03/53/keyboard-1869236_1280.jpg' },
];

const Home = ({ searchTerm }) => {
  const [products, setProducts] = useState([]);

  useEffect(() => {
    const sampleProducts = [
      { id: 1, name: 'Smartphone', price: 15000, image: 'https://cdn.pixabay.com/photo/2014/04/03/10/32/smartphone-310567_1280.png' },
      { id: 2, name: 'Laptop', price: 55000, image: 'https://cdn.pixabay.com/photo/2014/05/02/21/50/laptop-336643_1280.jpg' },
      { id: 3, name: 'Headphones', price: 2000, image: 'https://cdn.pixabay.com/photo/2016/11/29/03/53/headphones-1869237_1280.jpg' },
      { id: 4, name: 'Smartwatch', price: 8000, image: 'https://cdn.pixabay.com/photo/2014/04/03/10/32/smartwatch-310568_1280.png' },
      { id: 5, name: 'Camera', price: 25000, image: 'https://cdn.pixabay.com/photo/2014/04/03/10/32/camera-310569_1280.png' },
      { id: 6, name: 'Bluetooth Speaker', price: 3500, image: 'https://cdn.pixabay.com/photo/2016/11/29/03/53/speaker-1869238_1280.jpg' },
      { id: 7, name: 'Gaming Console', price: 45000, image: 'https://cdn.pixabay.com/photo/2014/05/02/21/50/game-controller-336645_1280.jpg' },
      { id: 8, name: 'Wireless Mouse', price: 1200, image: 'https://cdn.pixabay.com/photo/2014/04/03/10/32/mouse-310567_1280.png' },
      { id: 9, name: 'Mechanical Keyboard', price: 7000, image: 'https://cdn.pixabay.com/photo/2016/11/29/03/53/keyboard-1869236_1280.jpg' },
      { id: 10, name: 'External Hard Drive', price: 6000, image: 'https://cdn.pixabay.com/photo/2014/04/03/10/32/hard-drive-310570_1280.png' },
      { id: 11, name: 'Fitness Tracker', price: 4000, image: 'https://cdn.pixabay.com/photo/2014/04/03/10/32/fitness-310571_1280.png' },
      { id: 12, name: 'Drone', price: 35000, image: 'https://cdn.pixabay.com/photo/2014/04/03/10/32/drone-310572_1280.png' },
      { id: 13, name: 'VR Headset', price: 28000, image: 'https://cdn.pixabay.com/photo/2016/11/29/03/53/vr-headset-1869239_1280.jpg' },
      { id: 14, name: 'Tablet', price: 22000, image: 'https://cdn.pixabay.com/photo/2014/04/03/10/32/tablet-310573_1280.png' },
      { id: 15, name: 'Smart Home Hub', price: 9000, image: 'https://cdn.pixabay.com/photo/2016/11/29/03/53/smart-home-1869240_1280.jpg' },
    ];
    const filteredProducts = searchTerm && searchTerm.trim() !== ''
      ? sampleProducts.filter(product =>
          product.name.toLowerCase().includes(searchTerm.toLowerCase())
        )
      : sampleProducts;
    setProducts(filteredProducts);
  }, [searchTerm]);

  return (
    <div className="page home-page">
      {/* Banner Carousel */}
      <section className="banner-carousel">
        {bannerImages.map((src, index) => (
          <img key={index} src={src} alt={`Banner ${index + 1}`} className="banner-image" />
        ))}
      </section>

      {/* Deal of the Day */}
      <section className="deal-of-day">
        <h2>Deal of the Day</h2>
        <ProductList products={dealOfTheDayProducts} />
      </section>

      {/* Featured Categories */}
      <section className="featured-categories">
        <h2>Featured Categories</h2>
        <div className="categories-grid">
          {featuredCategories.map((category) => (
            <div key={category.id} className="category-card">
              <img src={category.image} alt={category.name} />
              <p>{category.name}</p>
            </div>
          ))}
        </div>
      </section>

      {/* Top Products */}
      <section className="top-products">
        <h2>Top Products</h2>
        {products.length > 0 ? (
          <ProductList products={products} />
        ) : (
          <p>No products found.</p>
        )}
      </section>
    </div>
  );
};

export default Home;
